import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
const PLACES = [
    { name: "Palo Alto", zip: "94303" },
    { name: "San Jose", zip: "94088" },
    { name: "Santa Cruz", zip: "95062" },
    { name: "Honolulu", zip: "96803" }
  ];
class Weather extends React.Component {
    render() {
        return(
            <h1>weather disp</h1>
        )
    }
}
export {Weather};
